const animationDuration=2e3,frameDuration=1e3/60,totalFrames=Math.round(2e3/(1e3/60)),easeOutQuad=t=>t*(2-t),animateCountUp=el=>{let frame=0;const countTo=parseInt(el.innerHTML,10),counter=setInterval(()=>{frame++;const progress=easeOutQuad(frame/totalFrames),currentCount=Math.round(countTo*progress);parseInt(el.innerHTML,10)!==currentCount&&(el.innerHTML=currentCount),frame===totalFrames&&clearInterval(counter)},1e3/60)},runAnimations=()=>{const countupEls=document.querySelectorAll(".countup");countupEls.forEach(animateCountUp)};